import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import Navbar from './components/common/Navbar';
import Footer from './components/common/Footer';
import Login from './components/auth/Login';
import Register from './components/auth/Register';
import StudentDashboard from './components/student/StudentDashboard';
import StudentProfile from './components/student/StudentProfile';
import JobList from './components/student/JobList';
import SkillVerification from './components/student/SkillVerification';
import VideoInterview from './components/student/VideoInterview';
import ClientDashboard from './components/client/ClientDashboard';
import PostJob from './components/client/PostJob';
import ViewProposals from './components/client/ViewProposals';
import AdminDashboard from './components/admin/AdminDashboard';
import ReviewInterview from './components/admin/ReviewInterview';
import ProtectedRoute from './components/common/ProtectedRoute';

const App: React.FC = () => {
  return (
    <AuthProvider>
      <Router>
        <Navbar />
        <Switch>
          <Route path="/login" component={Login} />
          <Route path="/register" component={Register} />
          <ProtectedRoute path="/student/dashboard" roles={['Student']} component={StudentDashboard} />
          <ProtectedRoute path="/student/profile" roles={['Student']} component={StudentProfile} />
          <ProtectedRoute path="/student/jobs" roles={['Student']} component={JobList} />
          <ProtectedRoute path="/student/skill-verification" roles={['Student']} component={SkillVerification} />
          <ProtectedRoute path="/student/video-interview/:interviewId" roles={['Student']} component={VideoInterview} />
          <ProtectedRoute path="/client/dashboard" roles={['Client']} component={ClientDashboard} />
          <ProtectedRoute path="/client/post-job" roles={['Client']} component={PostJob} />
          <ProtectedRoute path="/client/view-proposals" roles={['Client']} component={ViewProposals} />
          <ProtectedRoute path="/admin/dashboard" roles={['Admin']} component={AdminDashboard} />
          <ProtectedRoute path="/admin/review-interview/:interviewId" roles={['Admin']} component={ReviewInterview} />
        </Switch>
        <Footer />
      </Router>
    </AuthProvider>
  );
};

export default App;
